import React from "react";
import axios from "Axios";

function Update() {
  const postFile = async (file) => {
    const formdata = new FormData();
    formdata.append("file", file); // file and file here are key value pairs
    try {
      const result = await axios.post("http://localhost:3001/update", formdata);
      console.log(result);
    } catch (error) {}
    const result = await axios.post("http://localhost:3001/update", formdata);
    console.log(result);
  };

  return (
    <div>
      <div>
        <h1>Profile Updates</h1>
      </div>
      <div>
        <input
          type="file"
          onChange={(event) => {
            const file = event.target.files[0];
            console.log(file);
          }}
        />
      </div>
    </div>
  );
}

export default Update;
